import logo from "../../assets/img/logo.png"
import styled from "styled-components"

const Wrapper = styled.aside`
    position: relative;
    top: 20px;
  display: flex;

  img {
    padding: 0px 15px;
    width: 100px;
  }
  `

function List(params) {
    return(
        <Wrapper>

            <img src={logo} alt="logo"/>
        </Wrapper>
        
    )
}

export default List;
